import React, { useState, useRef } from 'react';
import { Outlet, Link, useLocation, useNavigate, useMatch } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import { 
  FiHome, 
  FiUser, 
  FiPlusSquare, 
  FiList, 
  FiMessageSquare, 
  FiHeart, 
  FiSettings,
  FiChevronDown,
  FiLogOut,
  FiUserCheck,
  FiShield,
  FiSend
} from 'react-icons/fi';

const Dashboard = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { user, logout } = useAuth();
  const [isUserMenuOpen, setIsUserMenuOpen] = useState(false);
  const [message, setMessage] = useState('');
  const isMessagesRoute = location.pathname === '/dashboard/messages';
  const isAdmin = user?.role === 'admin';
  const isAdminRoute = location.pathname.includes('/dashboard/admin');
  const messageInputRef = useRef(null);

  const menuItems = [
    { icon: FiHome, label: 'Overview', path: '/dashboard' },
    { icon: FiList, label: 'My Listings', path: '/dashboard/my-listings' },
    { icon: FiPlusSquare, label: 'Add Property', path: '/dashboard/create-property' },
    { icon: FiMessageSquare, label: 'Messages', path: '/dashboard/messages' },
    { icon: FiHeart, label: 'Favorites', path: '/dashboard/favorites' },
    { icon: FiHeart, label: 'My Interests', path: '/dashboard/interests' },
    { icon: FiSettings, label: 'Settings', path: '/dashboard/settings' },
  ];

  const adminMenuItems = [
    { icon: FiShield, label: 'Admin Dashboard', path: '/dashboard/admin' },
    { icon: FiUser, label: 'User Management', path: '/dashboard/admin/users' },
    { icon: FiList, label: 'Property Management', path: '/dashboard/admin/properties' },
    { icon: FiMessageSquare, label: 'Message Management', path: '/dashboard/admin/messages' },
  ];

  const handleSendMessage = async (e) => {
    e.preventDefault();
    if (!message.trim()) return;
    
    try {
      // TODO: Implement message sending logic
      console.log('Sending message:', message);
      setMessage('');
    } catch (error) {
      console.error('Error sending message:', error);
    }
  };

  const handleKeyDown = (e) => {
    if (e.key === 'Enter' && !e.shiftKey) {
      e.preventDefault();
      handleSendMessage(e);
    }
  };

  const toggleUserMenu = () => {
    setIsUserMenuOpen(!isUserMenuOpen);
  };

  const handleLogout = () => {
    logout();
    navigate('/login');
  };

  const toggleAdminView = () => {
    if (isAdminRoute) {
      navigate('/dashboard');
    } else {
      navigate('/dashboard/admin');
    }
    setIsUserMenuOpen(false);
  };

  if (isAdminRoute) {
    return (
      <div className="flex h-screen bg-gray-100">
        {/* Admin Sidebar */}
        <div className="hidden md:flex md:flex-shrink-0">
          <div className="flex flex-col w-64 bg-gray-800 text-white">
            <div className="flex items-center justify-center h-16 px-4 bg-gray-900">
              <h1 className="text-white font-bold text-xl">Admin Panel</h1>
            </div>
            
            {/* Admin Navigation */}
            <div className="flex flex-col flex-grow px-4 py-4 overflow-y-auto">
              <nav className="flex-1 space-y-1">
                {adminMenuItems.map((item) => (
                  <Link
                    key={item.path}
                    to={item.path}
                    className={`flex items-center px-4 py-3 text-sm font-medium rounded-md ${
                      location.pathname === item.path 
                        ? 'bg-gray-900 text-white' 
                        : 'text-gray-300 hover:bg-gray-700 hover:text-white'
                    }`}
                  >
                    <item.icon className="w-5 h-5 mr-3" />
                    {item.label}
                  </Link>
                ))}
              </nav>
            </div>
            
            {/* User Menu */}
            <div className="p-4 border-t border-gray-700">
              <div className="relative">
                <button
                  onClick={() => setIsUserMenuOpen(!isUserMenuOpen)}
                  className="flex items-center w-full p-2 text-left rounded-md hover:bg-gray-700"
                >
                  <div className="flex-shrink-0 w-8 h-8 rounded-full bg-ethiopian-green text-white flex items-center justify-center">
                    {user?.firstName?.[0] || 'A'}
                  </div>
                  <div className="ml-3 overflow-hidden">
                    <p className="text-sm font-medium text-white truncate">
                      {user?.firstName} {user?.lastName}
                    </p>
                    <p className="text-xs text-gray-300 truncate">Admin</p>
                  </div>
                </button>
                
                {/* Admin Switch to User View */}
                <div className="mt-2">
                  <button
                    onClick={() => navigate('/dashboard')}
                    className="w-full flex items-center justify-center px-4 py-2 text-sm text-white bg-blue-600 rounded-md hover:bg-blue-700"
                  >
                    <FiUser className="mr-2" />
                    Switch to User View
                  </button>
                </div>
              </div>
            </div>
          </div>
        </div>
        
        {/* Main Content */}
        <div className="flex flex-col flex-1 overflow-hidden">
          {/* Mobile header */}
          <header className="bg-white shadow-sm md:hidden">
            <div className="flex items-center justify-between px-4 py-3">
              <button
                onClick={() => document.querySelector('.sidebar').classList.toggle('hidden')}
                className="p-2 text-gray-500 rounded-md hover:bg-gray-100"
              >
                <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                  <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
                </svg>
              </button>
              <h1 className="text-lg font-medium text-gray-900">Admin Panel</h1>
              <div className="w-6" />
            </div>
          </header>
          
          {/* Page content */}
          <main className="flex-1 overflow-y-auto p-4 md:p-6 bg-gray-100">
            <Outlet />
          </main>
        </div>
      </div>
    );
  }

  return (
    <div className="flex h-screen bg-gray-100">
      {/* User Sidebar */}
      <div className="hidden md:flex md:flex-shrink-0">
        <div className="flex flex-col w-64 bg-white border-r border-gray-200">
          <div className="flex items-center justify-center h-16 px-4 bg-ethiopian-green">
            <h1 className="text-white font-bold text-xl">Dashboard</h1>
          </div>
          
          {/* User Navigation */}
          <div className="flex flex-col flex-grow px-4 py-4 overflow-y-auto">
            <nav className="flex-1 space-y-1">
              {menuItems.map((item) => (
                <Link
                  key={item.path}
                  to={item.path}
                  className={`flex items-center px-4 py-3 text-sm font-medium rounded-md ${
                    location.pathname === item.path
                      ? 'bg-gray-100 text-gray-900'
                      : 'text-gray-600 hover:bg-gray-50 hover:text-gray-900'
                  }`}
                >
                  <item.icon className="w-5 h-5 mr-3" />
                  {item.label}
                </Link>
              ))}
            </nav>
          </div>
          
          {/* User Menu */}
          <div className="p-4 border-t border-gray-200">
            <div className="relative">
              <button
                onClick={() => setIsUserMenuOpen(!isUserMenuOpen)}
                className="flex items-center w-full p-2 text-left rounded-md hover:bg-gray-50"
              >
                <div className="flex-shrink-0 w-8 h-8 rounded-full bg-ethiopian-green text-white flex items-center justify-center">
                  {user?.firstName?.[0] || 'U'}
                </div>
                <div className="ml-3 overflow-hidden">
                  <p className="text-sm font-medium text-gray-900 truncate">
                    {user?.firstName} {user?.lastName}
                  </p>
                  <p className="text-xs text-gray-500 truncate">{user?.email}</p>
                </div>
                <FiChevronDown
                  className={`ml-auto w-5 h-5 text-gray-400 transition-transform ${
                    isUserMenuOpen ? 'transform rotate-180' : ''
                  }`}
                />
              </button>
              
              {/* Dropdown Menu */}
              {isUserMenuOpen && (
                <div className="absolute bottom-full left-0 right-0 mb-2 w-full bg-white rounded-md shadow-lg overflow-hidden z-10 border border-gray-200">
                  {isAdmin && (
                    <button
                      onClick={() => {
                        navigate('/admin');
                        setIsUserMenuOpen(false);
                      }}
                      className="flex items-center w-full px-4 py-2 text-sm text-left text-gray-700 hover:bg-gray-100"
                    >
                      <FiShield className="w-4 h-4 mr-2" />
                      Admin Dashboard
                    </button>
                  )}
                  <button
                    onClick={() => {
                      navigate('/dashboard/settings');
                      setIsUserMenuOpen(false);
                    }}
                    className="flex items-center w-full px-4 py-2 text-sm text-left text-gray-700 hover:bg-gray-100"
                  >
                    <FiSettings className="w-4 h-4 mr-2" />
                    Settings
                  </button>
                  <button
                    onClick={() => {
                      logout();
                      navigate('/');
                    }}
                    className="flex items-center w-full px-4 py-2 text-sm text-left text-red-600 hover:bg-red-50"
                  >
                    <FiLogOut className="w-4 h-4 mr-2" />
                    Logout
                  </button>
                </div>
              )}
            </div>
          </div>
        </div>
      </div>

      {/* Main content */}
      <div className="flex flex-col flex-1 overflow-hidden">
        {/* Top Navigation */}
        <header className="bg-white shadow-sm">
          <div className="flex items-center justify-between px-4 py-3">
            <h1 className="text-lg font-semibold text-gray-900">
              {isAdminRoute ? 'Admin Dashboard' : 'My Dashboard'}
            </h1>
            
            <div className="flex items-center space-x-4">
              {/* Admin Toggle Button (only show if user is admin) */}
              {isAdmin && (
                <button
                  onClick={toggleAdminView}
                  className={`px-3 py-1.5 rounded-md text-sm font-medium flex items-center ${
                    isAdminRoute 
                      ? 'bg-purple-100 text-purple-700' 
                      : 'bg-gray-100 text-gray-700 hover:bg-gray-200'
                  }`}
                >
                  <FiShield className="mr-2" />
                  {isAdminRoute ? 'User View' : 'Admin View'}
                </button>
              )}
              
              {/* User Menu */}
              <div className="relative">
                <button
                  type="button"
                  className="flex items-center max-w-xs rounded-full focus:outline-none"
                  id="user-menu"
                  aria-expanded="false"
                  onClick={toggleUserMenu}
                >
                  <span className="sr-only">Open user menu</span>
                  <div className="h-8 w-8 rounded-full bg-blue-500 flex items-center justify-center text-white">
                    {user?.firstName?.charAt(0) || 'U'}
                  </div>
                  <FiChevronDown className="ml-1 text-gray-400" />
                </button>
                
                {/* Dropdown menu */}
                {isUserMenuOpen && (
                  <div className="origin-top-right absolute right-0 mt-2 w-56 rounded-md shadow-lg bg-white ring-1 ring-black ring-opacity-5 focus:outline-none z-10">
                    <div className="py-1" role="none">
                      <div className="px-4 py-2 text-sm text-gray-700 border-b">
                        <p className="font-medium">{user?.firstName} {user?.lastName}</p>
                        <p className="text-gray-500 text-xs">{user?.email}</p>
                      </div>
                      
                      
                      
                      <Link
                        to="/dashboard/settings"
                        className="block px-4 py-2 text-sm text-gray-700 hover:bg-gray-100 flex items-center"
                        onClick={() => setIsUserMenuOpen(false)}
                      >
                        <FiSettings className="mr-2" />
                        Settings
                      </Link>
                      
                      <button
                        onClick={handleLogout}
                        className="w-full text-left px-4 py-2 text-sm text-red-600 hover:bg-gray-100 flex items-center border-t mt-1"
                      >
                        <FiLogOut className="mr-2" />
                        Sign out
                      </button>
                    </div>
                  </div>
                )}
              </div>
            </div>
          </div>
        </header>

        {/* Page content */}
        <div className="flex-1 flex flex-col overflow-hidden">
          <main className="flex-1 overflow-y-auto p-4 md:p-6">
            <Outlet />
          </main>
          
          {/* Message input (only shown on messages route) */}
          {isMessagesRoute && (
            <div className="border-t border-gray-200 bg-white p-4">
              <form onSubmit={handleSendMessage} className="flex items-center">
                <input
                  type="text"
                  ref={messageInputRef}
                  value={message}
                  onChange={(e) => setMessage(e.target.value)}
                  onKeyDown={handleKeyDown}
                  placeholder="Type a message..."
                  className="flex-1 border border-gray-300 rounded-full px-4 py-2 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent"
                />
                <button
                  type="submit"
                  disabled={!message.trim()}
                  className={`ml-2 p-2 rounded-full ${
                    message.trim() 
                      ? 'bg-blue-500 text-white hover:bg-blue-600' 
                      : 'bg-gray-200 text-gray-400 cursor-not-allowed'
                  }`}
                >
                  <FiSend className="h-5 w-5" />
                </button>
              </form>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
